   asn1Init_e2ap_e2nodeComponentRequestPart (&pvalue->e2nodeComponentRequestPart);
   asn1Init_e2ap_e2nodeComponentResponsePart (&pvalue->e2nodeComponentResponsePart);
   rtxDListFastInit(&pvalue->extElem1);
