   RTXCTXTPUSHELEMNAME(pctxt, "ricActionDefinition");
   stat = asn1PE_e2ap_RICactionDefinition (pctxt, &pvalue->ricActionDefinition);
   if (stat != 0) return LOG_RTERR(pctxt, stat);
   RTXPOPELEMNAME(pctxt);

